import { createFeatureSelector, createSelector } from '@ngrx/store';
import { DynamicQueryPart, WithId } from '../state';
import { SampleData } from './sample.state';

export const selectSampleDataState = createFeatureSelector<SampleData[]>('sampleData');
export const selectSampleDataFiltersState = createFeatureSelector<DynamicQueryPart>('sampleDataFilters');

export const selectSampleData = createSelector(
    selectSampleDataState,
    (state: SampleData[] & WithId) => state);

export const selectSampleDataFilters = createSelector(
    selectSampleDataFiltersState,
    (state: DynamicQueryPart & WithId) => state);
